Cary Bay Zoo, situated on the foreshore of Lake Macquarie at Toronto, New South Wales.
Began in the 1940s when Tom Brown who bought the land to grow tomatoes extended his bird aviary and it grew like Topsy.  Brown died and the zoo was sold in December 1951 to Mr Reg Ward &amp; wife. The zoo closed in July 1958 .
The photo shows the Ward's daughter in 1954 with the wombat &quot;Sammy&quot;
